llywood”) in the dual role of Superman/Clark Kent, Rachel Brosnahan (“The Marvelous Mrs. Maisel”) as Lois Lane and Nicholas Hoult (the “X-Men” movies, “Juror #2”) as Lex Luthor.  The film also stars Edi Gathegi (“For All Mankind”), Anthony Carrigan (“Barry,” “Gotham”), Nathan Fillion (the “Guardians of the Galaxy” films, “The Suicide Squad”), Isabela Merced (“Alien Romulus”), Skyler Gisondo (“Licorice Pizza,” “Booksmart”), Sara Sampaio (“At Midnight”), María Gabriela de Faría (“The Moodys”), Wendell Pierce (“Selma,” “Tom Clancy’s Jack Ryan”), Alan Tudyk (“Andor”), Pruitt Taylor Vince (“Bird Box”) and Neva Howell (“Greedy People”).\n\n“Superman” is executive produced by Nikolas Korda, Chantal Nong Vo and Lars Winther.  Behind the camera, Gunn is joined by frequent collaborators, including director of photography Henry Braham, production designer Beth Mickle, costume designer Judianna Makovsky and composer John Murphy, along with composer David Fleming (“The Last of Us”) and editors William Hoy (“The Batman”) and Craig Alpert (“Deadpool 2,” “Blue Beetle”).  \n\nDC Studios Presents a Troll Court Entertainment/The Safran Company Production, A James Gunn Film, “Superman,” which will be in theaters and IMAX® nationwide on July 11, 2025, and internationally beginning 9 July 2025, distributed by Warner Bros. Pictures.\n\nConnect with DC Online: \nFollow DC on INSTAGRAM: https://bit.ly/3XxysUi \nLike DC on FACEBOOK: https://bit.ly/3oQVPs2 \nFollow DC on TWITTER: https://bit.ly/3ojGH9V \nVisit the DC WEBSITE: https://www.dc.com/ \nSubscribe to DC UNIVERSE INFINITE: https://bit.ly/3zAJZqX \nShop official Superman Merch: https://linktr.ee/ShopSuperman \nJoin the DC Discord Community:   / discord"},"lengthSeconds":"183","ownerProfileUrl":"http://www.youtube.com/@dcofficial","externalChannelId":"UCiifkYAs_bq1pt_zbNAzYGg","isFamilySafe":true,"availableCountries":["AD","AE","AF","AG","AI","AL","AM","AO","AQ","AR","AS","AT","AU","AW","AX","AZ","BA","BB","BD","BE","BF","BG","BH","BI" d by frequent collaborators, including director of photography Henry Braham, production designer Beth Mickle, costume designer Judianna Makovsky and composer John Murphy, along with composer David Fleming (“The Last of Us”) and editors William Hoy (“The Batman”) and Craig Alpert (“Deadpool 2,” “Blue Beetle”).  \n\nDC Studios Presents a Troll Court Entertainment/The Safran Company Production, A James Gunn Film, “Superman,” which will be in theaters and IMAX® nationwide on July 11, 2025, and internationally beginning 9 July 2025, distributed by Warner Bros. Pictures.\n\nConnect with DC Online: \nFollow DC on INSTAGRAM: https://bit.ly/3XxysUi \nLike DC on FACEBOOK: https://bit.ly/3oQVPs2 \nFollow DC on TWITTER: https://bit.ly/3ojGH9V \nVisit the DC WEBSITE: https://www.dc.com/ \nSubscribe to DC UNIVERSE INFINITE: https://bit.ly/3zAJZqX \nShop official Superman Merch: https://linktr.ee/ShopSuperman \nJoin the DC Discord Community:   / discord","commandRuns":[{"startIndex":63,"length":9,"onTap":{"innertubeCommand":{"clickTrackingParams":"CJYDENzXBBgPIhMIi6WTqJmrjwMVmcVJBx2DyC5A","commandMetadata":{"webCommandMetadata":{"url":"/hashtag/superman","webPageType":"WEB_PAGE_TYPE_BROWSE","rootVe":6827,"apiUrl":"/youtubei/v1/browse"}},"browseEndpoint":{"browseId":"FEhashtag","params":"6gUMCghzdXBlcm1hbhgB"}}},"loggingDirectives":{"trackingParams":"CJYDENzXBBgPIhMIi6WTqJmrjwMVmcVJBx2DyC5A"}},{"startIndex":2129,"length":22,"onTap":{"innertubeCommand":{"clickTrackingParams":"CJUDEM2rARgBIhMIi6WTqJmrjwMVmcVJBx2DyC5ASM2x8PTFpcaPOw==","commandMetadata":{"webCommandMetadata":{"url":"https://www.youtube.com/redirect?event=video_description\u0026redir_token=QUFFLUhqbnlmLWw4N3JjWFBDMWIxQTcyYzFXUmNFMkd1QXxBQ3Jtc0trbmhtLUdtT1JWSEZjZ1RWZUlLRC15clFvM3FxYXhGSEJnVTFRTEF6aFh3WGZsUWJMZ1VTWTR2WWF5YWFhTW05Nkx3dS1MdWVaVmsyaHN0VW54QVk4eXJ6eHcxamttcDhfMEd1WTBBTUpzMVhnQXZCdw\u0026q=https%3A%2F%2Fbit.ly%2F3XxysUi\u0026v=Ox8ZLF6cGM0","webPageType":"WEB_PAGE_TYPE_UNKNOWN","rootVe":83769}},"urlEndpoint":{" se with a singular blend of epic action, humor and heart, delivering a Superman who’s driven by compassion and an inherent belief in the goodness of humankind. \n\nDC Studios heads Peter Safran and Gunn are producing the film, which Gunn directs from his own screenplay, based on characters from DC, Superman created by Jerry Siegel and Joe Shuster.\n\nThe film stars David Corenswet (“Twisters,” “Hollywood”) in the dual role of Superman/Clark Kent, Rachel Brosnahan (“The Marvelous Mrs. Maisel”) as Lois Lane and Nicholas Hoult (the “X-Men” movies, “Juror #2”) as Lex Luthor.  The film also stars Edi Gathegi (“For All Mankind”), Anthony Carrigan (“Barry,” “Gotham”), Nathan Fillion (the “Guardians of the Galaxy” films, “The Suicide Squad”), Isabela Merced (“Alien Romulus”), Skyler Gisondo (“Licorice Pizza,” “Booksmart”), Sara Sampaio (“At Midnight”), María Gabriela de Faría (“The Moodys”), Wendell Pierce (“Selma,” “Tom Clancy’s Jack Ryan”), Alan Tudyk (“Andor”), Pruitt Taylor Vince (“Bird Box”) and Neva Howell (“Greedy People”).\n\n“Superman” is executive produced by Nikolas Korda, Chantal Nong Vo and Lars Winther.  Behind the camera, Gunn is joined by frequent collaborators, including director of photography Henry Braham, production designer Beth Mickle, costume designer Judianna Makovsky and composer John Murphy, along with composer David Fleming (“The Last of Us”) and editors William Hoy (“The Batman”) and Craig Alpert (“Deadpool 2,” “Blue Beetle”).  \n\nDC Studios Presents a Troll Court Entertainment/The Safran Company Production, A James Gunn Film, “Superman,” which will be in theaters and IMAX® nationwide on July 11, 2025, and internationally beginning 9 July 2025, distributed by Warner Bros. Pictures.\n\nConnect with DC Online: \nFollow DC on INSTAGRAM: https://bit.ly/3XxysUi \nLike DC on FACEBOOK: https://bit.ly/3oQVPs2 \nFollow DC on TWITTER: https://bit.ly/3ojGH9V \nVisit the DC WEBSITE: https://www.dc.com/ \nSubscribe to DC UNIVERSE INFINITE: https://bit.ly/3zA
